import * as httpRequest from "../utils/httpRequest";

export const postAccount = async (body) => {
    try {
        const response = await httpRequest.post(`account/signup`, formData, {
        headers: {
            'Content-Type': 'multipart/form-data',
        },
        });
        return response;
    } catch (error) {
        console.log(error);
    }
}
